import React from "react";
import LoginInput from "./LoginInput";

const LoginForm = () => {
  return (
    <div className=" bg-white w-[24.25rem] h-[35rem] mx-auto">
      {/* px-[4.25rem] py-[3.75rem] */}
      <h1 className="text-[2rem] mb-7 mt-[3.75rem]">Sing In</h1>
      <LoginInput
        inputType="email"
        id="loginEmail"
        labelContent="Email or phone number"
      />
      <LoginInput inputType="password" id="loginpass" labelContent="Password" />
    </div>
  );
};

export default LoginForm;
